import React, { Component } from "react";
import Projects from "./Projects";
import Skills from "./Skills";
import Experience from "./Experience";

class Home extends Component {
  chooseName = () => {
    return (this.props.location.pathname === "/projects2" ? this.props.resumeData.projects : this.props.resumeData.projects2)
  };

  render() {
    return (
      <div>
        <Projects
          resumeHomeProjects={this.chooseName()}
          resumeBasicInfo={this.props.resumeData.basic_info}
        />
        <Skills
          sharedSkills={this.props.sharedData.skills}
          resumeBasicInfo={this.props.resumeData.basic_info}
        />
        <Experience
          resumeExperience={this.props.resumeData.experience}
          resumeBasicInfo={this.props.resumeData.basic_info}
        />
      </div>
    );
  }
}

export default Home;


